import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
    <header>
        <p>helo wrol </p>
        <div className="branding">Render<span><a href="#showcase"><img src="./images/Logo2.png" alt="arrow" className="arrow-icon" /></a></span></div>
        <div className="nav">
            <ul>
            <li><a href="#showcase">Home</a></li>
            <li><a href="#our-tools">Tools</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#testimonial">Testimonial</a></li>
            <li><a href="#newsletter">Subscribe</a></li>
            </ul>
        </div>
    </header>
</div>
  );
}

export default App;
